import React from 'react'
import './Card.css';
import Todo from './Todo';



function Card() {
  return (
    <div className="container">
    <Todo  title="Bangladesh"  description="Bangladesh is very attractive Country" />
    <Todo  title="India"  description="India Is Our Neighbor Country" />
    <Todo  title="Pakistan"  description="Pakistan Is Neighbor  Country" />
  </div>
  )
}

export default Card
